import { useEffect, useState } from 'react';

function Fuse() {
  const [pokeIds1, setPokeIds1] = useState([]);
  const [pokeIds2, setPokeIds2] = useState([]);

  // symulacja pobrania ID-ków Pokémonów
  useEffect(() => {
    // przykładowe ID Pokémonów – możesz je pobierać z API
    const ids1 = [1, 4, 7, 25, 150];
    const ids2 = [1, 3, 7, 250, 420]
    setPokeIds1(ids1);
    setPokeIds2(ids2);
  }, []);

  return (
    <div>
        <div>
            <select>
            {pokeIds1.map(id => (
                <option key={id} value={id}>
                    Pokémon {id}
                </option>
            ))}
            </select>
        </div>
      
      <select>
        {pokeIds2.map(id => (
          <option key={id} value={id}>
            <img src = {`https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/${id}.png`}></img>
            Pokémon {id}
          </option>
        ))}
      </select>
    </div>
  );
}

export default Fuse;
